import React from 'react';
import PropTypes from 'prop-types';
import { Col, List, Row } from 'antd';

ListViewTest.propTypes = {};

function ListViewTest({ onClick, current }) {
	console.log(current);

	return (
		<List
			size='small'
			bordered
			dataSource={current}
			renderItem={(item) => (
				<List.Item>
					<Row>
						{
							<Col span={24}>
								<p>{item.title}</p>
							</Col>
						}
					</Row>
				</List.Item>
			)}
		/>
	);
}

export default ListViewTest;
